import './Profile.css';

const Profile = () => {
    return(
        <div className="Profile">
            <img src="../../.images/avatar.jpg" className="Avatar"/>
            <div className="Info">
                <h4>Username</h4><hr/>
                <p>Любимый клуб</p>
                <p>Симпатичные клубы</p>
                <p>Количество постов</p>
                <p>Рейтинг</p>
            </div>
            <div className="MyPosts">
                <h3>Посты пользователя</h3>
                <button>Добавить пост</button><hr/>
            </div>
        </div>
    );
}

export default Profile;
